import React from "react";

import "./Footer.scss";

const Footer = () => {
  return (
    <footer>
      <div className="footer-line" />
      <label className="footer-text">Contact us</label> {/*will be a later*/}
      <label className="footer-text">Terms of use</label>
      <label className="footer-text">Privacy policy</label>
    </footer>
  );
};

export default Footer;
